import "/App.css";

import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";

import About from "./components/About";

function App() {
  return (
    <>
      <Router>
        <Routes>

            <Route exact path="/" component={About} />

            <Route path="/about" component={About} />

            <Navigate to="/" />

        </Routes>
      </Router>
    </>
  );
}

export default App;
